import { ref } from "vue"

export const useUserStore = defineStore('user', () => {
  const count = ref(0)
  const fname = ref('User')
  const lname = ref("")
  const doubleCount = computed(() => count.value * 2)
  function increment() {
    count.value++
  }

  return { count, fname, lname, doubleCount, increment }
})
